import React, { Component } from "react";
import { Modal } from "react-bootstrap";

class LikeShow extends Component {
  constructor(props) {
    super(props);

    this.state = {
      usernames: [],
    };
  }

  componentDidMount() {
    fetch(`http://127.0.0.1:8000/uapi/users/${this.props.user}/`, {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
        Authorization: "Token d194a979f94b27587f743071a64f8d5c7d3dfb01",
      },
    })
      .then((resp) => resp.json())
      .then((res) => [res.username].concat(this.state.usernames))
      .catch((error) => console.log(error));
  }

  render() {
    return (
      <div>
        <Modal
          show={this.state.show}
          size="md"
          aria-labelledby="contained-modal-title-vcenter"
          centered
        >
          <Modal.Header
            closeButton
            onClick={() => {
              this.setState({ show: false });
            }}
          >
            <Modal.Title id="contained-modal-title-vcenter">
              Reactions
            </Modal.Title>
          </Modal.Header>
          <Modal.Body>
            {this.state.usernames.map((username) => {
              <h4>{username}</h4>;
            })}
          </Modal.Body>
          {/* <Modal.Footer></Modal.Footer> */}
        </Modal>
      </div>
    );
  }
}

export default LikeShow;
